import './App.css';

function App() {
  return (
    <div className="App">

          <div class="container">
              <div class="box">
                  <button class="btn transfer-btn">
                      <i class="fas fa-money-check-alt"></i>
                      Realizar Transferência
                  </button>
                  <button class="btn consult-btn">Consultar Transações</button>
              </div>
          </div>
    </div>
  );
}

export default App;
